  return (
    <GluestackUIProvider config={config}>
      <View p="$2">
        <Text fontSize="2em" fontWeight="bold">Welcome to the</Text><Text color='$amber500' fontSize="2em" fontWeight="bold" alignContent='center'>NoteSketch</Text>

      </View>
    </GluestackUIProvider>
  )
}
